import styled from "styled-components";

const AuctionStyle = styled("div")`
  display: flex;
  flex-direction: column;
  align-items: center;
  .theForm {
    .title,
    .description,
    .ImageLink,
    .genderList {
      margin-bottom: 20px;
      width: 60%;
    }
}
.genderList {
    list-style: none;
}
`;

export default AuctionStyle;
